import React from "react";

function TopProducts() {
    return (
        <div class="jumbotron jumbotron-fluid">
            <div class="container">
                <h1 class="display-4">Top Products</h1>
                <div>Placeholder for the top products display</div>
            </div>
        </div>
    );
}

export default TopProducts;
